import React from "react";
import "./App.css";
import { CourseMap } from "./Components/CourseMap.1.tsx";

const App = () => {
  return (
    <>
      <h3>How to use this course map:</h3>
      <p>
        All upper division courses highlight their respective prerequisites. All
        concentrations map to all related courses and lower divs map to related
        concentrations. Note that BioE11 has the alternative prerequisite of
        Bio1A in most cases, check this website to be sure:
        https://guide.berkeley.edu/courses/bio_eng/
      </p>
      <br></br>
      <CourseMap />
    </>
  );
};

export default App;
